function SetApplicationMenu(n){$.ajax({url:n,type:"POST",dataType:"json"}).success(function(n){var t=n.data.split(","),i;$.each(t,function(n,t){$("#"+t).removeClass("disabled")});i="/"+t[0]+"/index/"+t[1];$("#homePage").attr("href",i);$("#"+n.activeFor).addClass("active")}).error(function(){alert("Nenhum resultado encontrado")})}